from itertools import permutations
def convert_binary_to_text(bin_str):
    # Clean up the input by removing newlines and replacing spaces with '0' and dots with '1'
    formatted_bin_str = bin_str.replace('\n', '').replace(' ', '0').replace('.', '1').strip()
    
    # Ensure the binary string's length is a multiple of 8 by padding with leading zeros if necessary
    if len(formatted_bin_str) % 8 != 0:
        pad_size = 8 - (len(formatted_bin_str) % 8)
        formatted_bin_str = formatted_bin_str.zfill(len(formatted_bin_str) + pad_size)
    
    # Break the binary string into groups of 8 bits
    bin_chunks = [formatted_bin_str[i:i+8] for i in range(0, len(formatted_bin_str), 8)]
    
    # Convert each 8-bit binary chunk into a character and form the text
    try:
        decoded_message = ''.join([chr(int(chunk, 2)) for chunk in bin_chunks])
    except ValueError as conversion_error:
        print(f"Error encountered during conversion: {conversion_error}")
        decoded_message = ""
    
    return decoded_message


def decode_text_from_permutations(seq_list):
    # Create all possible permutations of the provided sequences
    possible_combinations = permutations(seq_list)
    
    decoded_results = []
    for sequence_set in possible_combinations:
        # Trim whitespace from the start and end of each sequence
        cleaned_sequences = [sequence.strip() for sequence in sequence_set]
        # Merge all cleaned sequences into a single string
        merged_sequence = ''.join(cleaned_sequences)
        # Convert the binary string into text
        decoded_result = convert_binary_to_text(merged_sequence)
        decoded_results.append((decoded_result, sequence_set))
    
    return decoded_results

